              "import { PullRequest } from './types/PullRequest'\nimport { Release } from './types/Release'\nimport { ICommitsAdapter } from './interfaces/ICommitsAdapter'\nimport { Commit } from './types/Commit'\n\nconst ONE_DAY = 24 * 60 * 60 * 1000\nexport class LeadTime {\n  log: string[] = []\n  pulls: PullRequest[]\n  releases: {\n    published: number\n    url: string\n    name: string\n    published_at: string\n  }[]\n  today: Date\n  commitsAdapter: ICommitsAdapter\n\n  constructor(\n    pulls: PullRequest[],\n    releases: Release[],\n    commitsAdapter: ICommitsAdapter,\n    today: Date | null = null\n  ) {\n    if (today === null) {\n      this.today = new Date()\n    } else {\n      this.today = today\n    }\n\n    this.pulls = pulls.filter(\n      p => +new Date(p.merged_at) > this.today.valueOf() - 31 * ONE_DAY\n    )\n    this.releases = releases.map(r => {\n      return {\n        published: +new Date(r.published_at),\n        url: r.url,\n        name: r.name,\n        published_at: r.published_at\n      }\n    })\n    this.commitsAdapter = commitsAdapter\n  }\n\n  getLog(): string[] {\n    return this.log\n  }\n  async getLeadTime(filtered = false): Promise<" +
              "number> {\n    if (this.pulls.length === 0 || this.releases.length === 0) {\n      return 0\n    }\n\n    if (filtered) {\n      this.log.push(`\\nLog is filtered - only feat and fix.`)\n    }\n\n    const leadTimes: number[] = []\n    for (const pull of this.pulls) {\n      if (\n        typeof pull.merged_at === 'string' &&\n        pull.merged_at &&\n        typeof pull.base.repo.name === 'string' &&\n        pull.base.repo.name &&\n        pull.base.ref === 'main'\n      ) {\n        if (\n          filtered &&\n          !(pull.title.startsWith('feat') || pull.title.startsWith('fix'))\n        ) {\n          continue\n        }\n\n        const mergeTime = +new Date(pull.merged_at)\n        const laterReleases = this.releases.filter(\n          r => r.published > mergeTime && r.url.includes(pull.base.repo.name)\n        )\n        if (laterReleases.length === 0) {\n          continue\n        }\n        const deployTime: number = laterReleases[0].published\n        this.log.push(`pull->      ${pull.merged_at} : ${pull.title}`)\n        const commits = (await this.commitsAdapter.getCommitsFromUrl(\n          pull.commits_url\n        )) as Commit[]\n        const commitTime: number = commits\n          .map(c => +new Date(c.commit.committer.date))\n          .sort((a, b) => a - b)[0]\n        const firstCommit = commits.sort((a, b) => {\n          return (\n            +new Date(a.commit.committer.date) -\n            +new Date(b.commit.committer.date)\n          )\n        })[0]\n        this.log.push(\n          `  commit->  ${firstCommit.commit.committer.date} : ${firstCommit.commit.message}`\n        )\n        this.log.push(\n          `  release-> ${laterReleases[0].published_at} : ${laterReleases[0].name}`\n        )\n\n        const leadTime = (deployTime - commitTime) / ONE_DAY\n        leadTimes.push(leadTime)\n        this.log.push(`  ${leadTime.toFixed(2)} days`)\n      }\n    }\n    if (leadTimes.length === 0) {\n      return 0\n    }\n\n    return (\n      Math.round((leadTimes.reduce((p, c) => p + c) / leadTimes.length) * 100) /\n      100\n    )\n  }\n}\n"

              "import { Issue } from './types/Issue'\nimport { Release } from './types/Release'\n\nexport interface BugTime {\n  start: number\n  end: number\n  repo: string\n}\n\nexport interface ReleaseDate {\n  published: number\n  url: string\n}\n\nconst ONE_DAY = 1000 * 60 * 60 * 24\n\nexport class MeanTimeToRestore {\n  today: Date\n  issues: Issue[]\n  releases: Release[]\n  releaseDates: ReleaseDate[] // array of object with unix time and repo url\n\n  constructor(issues: Issue[], releases: Release[], today: Date | null = null) {\n    if (today === null) {\n      this.today = new Date()\n    } else {\n      this.today = today\n    }\n    this.issues = issues\n    this.releases = releases\n    if (this.releases === null || this.releases.length === 0) {\n      throw new Error('Empty release list')\n    }\n    this.releaseDates = this.releases\n      .map(function (r) {\n        return { published: +new Date(r.published_at), url: r.url }\n      })\n      .sort((a, b) => a.published - b.published) // Sort ascending\n  }\n\n  getBugCount(): BugTime[] {\n    const bugs: Issue[] = this.getIssuesTaggedAsBug()\n    const values: BugTime[] = this.getStartAndEndTimesForBugs(bugs)\n\n    return values\n  }\n\n  private getStartAndEndTimesForBugs(bugs: Issue[]): BugTime[] {\n    const values: BugTime[] = []\n    for (const bug of bugs) {\n      const createdAt = +new Date(bug.created_at)\n      const closedAt = +new Date(bug.closed_at as string)\n      const repoName = bug.repository_url.split('/').reverse()[0]\n      if (\n        bug.closed_at != null &&\n        this.hasLaterRelease(closedAt, repoName) &&\n        this.hasPreviousRelease(createdAt, repoName)\n      ) {\n        values.push({\n          start: createdAt,\n          end: closedAt,\n          repo: repoName\n        })\n      }\n    }\n    return values\n  }\n\n  private getIssuesTaggedAsBug(): Issue[] {\n    const bugs: Issue[] = []\n    for (const issue of this.issues) {\n      const createdAt = +new Date(issue.created_at)\n      if (\n        issue.labels.filter(label => label.name === 'bug').length > 0 &&\n        createdAt > this.today.getTime() - 30 * ONE_DAY\n      ) {\n        bugs.push(issue)\n      }\n    }\n    return bugs\n  }\n\n  hasPreviousRelease(date: number, repo: string): boolean {\n    return (\n      this.releaseDates.filter(r => r.published <" +
              ' date && r.url.includes(repo))\n        .length > 0\n    )\n  }\n\n  getReleaseBefore(date: number, repo: string): ReleaseDate {\n    const rdates: ReleaseDate[] = this.releaseDates.filter(\n      r => r.published <' +
              " date && r.url.includes(repo)\n    )\n\n    if (rdates.length === 0) {\n      throw new Error('No previous releases')\n    }\n\n    return rdates.pop() as ReleaseDate\n  }\n\n  getReleaseAfter(date: number, repo: string): ReleaseDate {\n    const rdates: ReleaseDate[] = this.releaseDates.filter(\n      r => r.published > date && r.url.includes(repo)\n    )\n\n    if (rdates.length === 0) {\n      throw new Error('No later releases')\n    }\n\n    return rdates.reverse().pop() as ReleaseDate\n  }\n\n  hasLaterRelease(date: number, repo: string): boolean {\n    return (\n      this.releaseDates.filter(r => r.published > date && r.url.includes(repo))\n        .length > 0\n    )\n  }\n\n  getRestoreTime(bug: BugTime): number {\n    const prevRel = this.getReleaseBefore(bug.start, bug.repo)\n    const nextRel = this.getReleaseAfter(bug.end, bug.repo)\n\n    return nextRel.published - prevRel.published\n  }\n\n  mttr(): number {\n    const ttr: number[] = this.getBugCount().map(bug => {\n      return this.getRestoreTime(bug)\n    }, this)\n\n    if (ttr.length === 0) {\n      return 0\n    }\n\n    let sum = 0\n    for (const ttrElement of ttr) {\n      sum += ttrElement\n    }\n\n    return Math.round((sum / ttr.length / ONE_DAY) * 100) / 100 // Two decimals\n  }\n}\n"

              "/* eslint-disable @typescript-eslint/no-explicit-any */\nimport * as core from '@actions/core'\nimport * as github from '@actions/github'\nimport { ReleaseAdapter } from './ReleaseAdapter'\nimport { DeployFrequency } from './DeployFrequency'\nimport { ChangeFailureRate } from './ChangeFailureRate'\nimport { Issue } from './types/Issue'\nimport { IssuesAdapter } from './IssuesAdapter'\nimport { MeanTimeToRestore } from './MeanTimeToRestore'\nimport { PullRequestsAdapter } from './PullRequestsAdapter'\nimport { CommitsAdapter } from './CommitsAdapter'\nimport { LeadTime } from './LeadTime'\nimport { Release } from './types/Release'\nimport { PullRequest } from './types/PullRequest'\n\nasync function run(): Promise<" +
              "void> {\n  try {\n    let repo: string = core.getInput('repo')\n    if (repo === '' || repo === null) {\n      repo = github.context.repo.repo\n      core.info(`${github.context.repo.repo} - default repo.`)\n    }\n\n    // Allow for multiple repos, ex: [val1, val2, val3]\n    const repositories = repo\n      .split(/[[\\]\\n,]+/)\n      .map(s => s.trim())\n      .filter(x => x !== '')\n\n    let owner: string = core.getInput('owner')\n    if (owner === '' || owner === null) {\n      owner = github.context.repo.owner\n      core.info(`${github.context.repo.owner} - default owner.`)\n    }\n\n    for (const repository of repositories) {\n      core.info(`${owner}/${repository}`)\n    }\n\n    const repoCount = repositories.length\n    if (repoCount > 1) {\n      core.info(`${repoCount.toString()} repositories registered.`)\n    } else {\n      core.info(`${repoCount.toString()} repository registered.`)\n    }\n\n    repo = repositories[0]\n\n    let token: string | undefined = core.getInput('token')\n    if (token === '' || token === null) {\n      // token = github.context.token;\n      token = process.env['GH_TOKEN']\n    }\n\n    const logging: string | undefined = core.getInput('logging')\n    const filtered: boolean | undefined =\n      core.getInput('filtered') === 'true' ? true : false\n\n    const rel = new ReleaseAdapter(token, owner, repositories)\n    const releaseList = (await rel.GetAllReleasesLastMonth()) as Release[]\n    const df = new DeployFrequency(releaseList)\n    core.setOutput('deploy-rate', df.rate())\n    if (logging === 'true') {\n      core.setOutput('deploy-rate-log', df.getLog().join('\\n'))\n    }\n\n    const prs = new PullRequestsAdapter(token, owner, repositories)\n    const commits = new CommitsAdapter(token)\n    const pulls = (await prs.GetAllPRsLastMonth()) as PullRequest[]\n    const lt = new LeadTime(pulls, releaseList, commits)\n    const leadTime = await lt.getLeadTime(filtered)\n    core.setOutput('lead-time', leadTime)\n    if (logging === 'true') {\n      core.setOutput('lead-time-log', lt.getLog().join('\\n'))\n    }\n\n    const issueAdapter = new IssuesAdapter(token, owner, repositories)\n    const issueList: Issue[] | undefined =\n      await issueAdapter.GetAllIssuesLastMonth()\n    if (issueList) {\n      const cfr = new ChangeFailureRate(issueList, releaseList)\n      core.setOutput('change-failure-rate', cfr.Cfr())\n      const mttr = new MeanTimeToRestore(issueList, releaseList)\n      core.setOutput('mttr', mttr.mttr())\n    } else {\n      core.setOutput('change-failure-rate', 'empty issue list')\n      core.setOutput('mttr', 'empty issue list')\n    }\n  } catch (error: any) {\n    core.setFailed(error.message)\n  }\n}\n\nrun()\n"

              " +new Date(b.published_at) ? -1 : 1\n      )\n      .filter(\n        r =>\n          +new Date(r.published_at) >\n          this.today.valueOf() - 31 * 24 * 60 * 60 * 1000\n      )\n    this.repos = []\n  }\n\n  getBugs(): Issue[] {\n    const bugs: Issue[] = []\n    for (const issue of this.issues) {\n      if (issue.labels.filter(label => label.name === 'bug').length > 0) {\n        bugs.push(issue)\n      }\n    }\n\n    return bugs\n  }\n\n  Cfr(): number {\n    if (this.issues.length === 0 || this.releases.length === 0) {\n      return 0\n    }\n    const bugs = this.getBugs()\n\n    for (const bug of bugs) {\n      const repo = bug.repository_url.split('/').reverse()[0]\n      if (!this.repos.includes(repo)) {\n        this.repos.push(repo)\n      }\n    }\n    // const bugDates = this.getBugs().map(issue => +new Date(issue.created_at))\n    const releaseDates = this.releases.map(function (release) {\n      return { published: +new Date(release.published_at), url: release.url }\n    })\n    for (const repo of this.repos) {\n      releaseDates.push({ published: Date.now(), url: repo })\n    }\n\n    let failedDeploys = 0\n    for (const repo of this.repos) {\n      const releasesForRepo = releaseDates.filter(r => r.url.includes(repo))\n      for (let i = 0; i <" +
              " releasesForRepo.length - 1; i++) {\n        if (\n          bugs.filter(function (bug) {\n            if (bug.repository_url.split('/').reverse()[0] !== repo) {\n              return false\n            }\n            const bugDate = +new Date(bug.created_at)\n            return (\n              bugDate > releasesForRepo[i].published &&\n              bugDate <" +
              ' releasesForRepo[i + 1].published\n            )\n          }).length > 0\n        ) {\n          failedDeploys += 1\n        }\n      }\n    }\n    return Math.round((failedDeploys / this.releases.length) * 100)\n  }\n}\n'
          }

              "import { Issue } from '../src/types/Issue'\nimport { Release } from '../src/types/Release'\nimport fs from 'fs'\nimport {\n  BugTime,\n  ReleaseDate,\n  MeanTimeToRestore\n} from '../src/MeanTimeToRestore'\n\ndescribe('MeanTimeToRestore should', () => {\n  const issues: Issue[] = JSON.parse(\n    fs.readFileSync('./__tests__/test-data/issue-list.json').toString()\n  )\n  const releases: Release[] = JSON.parse(\n    fs.readFileSync('./__tests__/test-data/releases.json').toString()\n  )\n  const mttr = new MeanTimeToRestore(\n    issues,\n    releases,\n    new Date('2023-04-30T16:50:53Z')\n  )\n\n  it('get bugs last month', () => {\n    const bugCount = mttr.getBugCount()\n\n    expect(bugCount.length).toBe(2)\n    expect(bugCount[0].start).toBe(+new Date('2023-04-25T21:21:49Z'))\n    expect(bugCount[1].end).toBe(+new Date('2023-04-23T16:47:40Z'))\n  })\n\n  it('find release time before date', () => {\n    const before1: ReleaseDate = mttr.getReleaseBefore(\n      +new Date('2023-04-25T21:21:49Z'),\n      'devops-metrics-action'\n    )\n    const before2: ReleaseDate = mttr.getReleaseBefore(\n      +new Date('2023-04-29T12:54:45Z'),\n      'devops-metrics-action'\n    )\n\n    expect(before1.published).toBe(+new Date('2023-04-22T20:28:29Z'))\n    expect(before2.published).toBe(+new Date('2023-04-29T06:18:36Z'))\n  })\n\n  it('throw error when no earlier dates', () => {\n    const t = (): void => {\n      mttr.getReleaseBefore(\n        +new Date('2023-04-05T21:21:49Z'),\n        'devops-metrics-action'\n      )\n    }\n\n    expect(t).toThrow('No previous releases')\n  })\n\n  it('find release time after date', () => {\n    const after1: ReleaseDate = mttr.getReleaseAfter(\n      +new Date('2023-04-25T21:21:49Z'),\n      'devops-metrics-action'\n    )\n    const after2: ReleaseDate = mttr.getReleaseAfter(\n      +new Date('2023-04-29T12:54:45Z'),\n      'devops-metrics-action'\n    )\n\n    expect(after1.published).toBe(+new Date('2023-04-29T06:18:36Z'))\n    expect(after2.published).toBe(+new Date('2023-04-30T16:06:06Z'))\n  })\n\n  it('throw error when no later dates', () => {\n    const t = (): void => {\n      mttr.getReleaseAfter(\n        +new Date('2023-05-05T21:21:49Z'),\n        'devops-metrics-action'\n      )\n    }\n\n    expect(t).toThrow('No later releases')\n  })\n\n  it('check if there are later releases', () => {\n    const hasLaterRelease: boolean = mttr.hasLaterRelease(\n      +new Date('2023-04-29T12:54:45Z'),\n      'devops-metrics-action'\n    )\n    const hasNoLaterRelease: boolean = mttr.hasLaterRelease(\n      +new Date('2023-04-30T17:29:44Z'),\n      'devops-metrics-action'\n    )\n\n    expect(hasLaterRelease).toBe(true)\n    expect(hasNoLaterRelease).toBe(false)\n  })\n\n  it('get time for a bug 1', () => {\n    const bug: BugTime = {\n      start: +new Date('2023-04-22T21:44:06Z'),\n      end: +new Date('2023-04-23T16:47:40Z'),\n      repo: 'devops-metrics-action'\n    }\n    const releaseDiff =\n      +new Date('2023-04-29T06:18:36Z') - +new Date('2023-04-22T20:28:29Z')\n\n    const fixTime: number = mttr.getRestoreTime(bug)\n\n    expect(fixTime).toBe(releaseDiff)\n    // console.log(fixTime/(1000*60*60*24))\n  })\n  it('get time for a bug 2', () => {\n    const bug: BugTime = {\n      start: +new Date('2023-04-25T21:21:49Z'),\n      end: +new Date('2023-04-29T12:54:45Z'),\n      repo: 'devops-metrics-action'\n    }\n    const releaseDiff =\n      +new Date('2023-04-30T16:06:06Z') - +new Date('2023-04-22T20:28:29Z')\n\n    const fixTime: number = mttr.getRestoreTime(bug)\n\n    expect(fixTime).toBe(releaseDiff)\n\n    // console.log(fixTime/(1000*60*60*24))\n  })\n\n  it('get mttr for bug 1 when no release after bug 2', () => {\n    const bugList: Issue[] = [\n      {\n        created_at: '2023-04-22T21:44:06Z',\n        closed_at: '2023-04-23T16:47:40Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      },\n      {\n        created_at: '2023-04-25T21:21:49Z',\n        closed_at: '2023-04-29T12:54:45Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      }\n    ] as Issue[]\n    const localReleases = [\n      {\n        published_at: '2023-04-25T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-20T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      }\n    ] as Release[]\n\n    // console.log(fixTime/(1000*60*60*24))\n    const mttrEmpty = new MeanTimeToRestore(\n      bugList,\n      localReleases,\n      new Date('2023-04-29T12:54:45Z')\n    )\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(4)\n  })\n\n  it('throw error when empty release list', () => {\n    const m = (): void => {\n      new MeanTimeToRestore([] as Issue[], [] as Release[])\n    }\n    expect(m).toThrow('Empty release list')\n  })\n\n  it('get mttr for bug 1 when release in wrong repo after bug 2', () => {\n    const bugList: Issue[] = [\n      {\n        created_at: '2023-04-22T21:44:06Z',\n        closed_at: '2023-04-23T16:47:40Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      },\n      {\n        created_at: '2023-04-25T21:21:49Z',\n        closed_at: '2023-04-29T12:54:45Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      }\n    ] as Issue[]\n    const localReleases = [\n      {\n        published_at: '2023-04-25T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-30T00:00:00Z',\n        url: 'path/with/other-repo/in/it'\n      },\n      {\n        published_at: '2023-04-20T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      }\n    ] as Release[]\n\n    const mttrEmpty = new MeanTimeToRestore(\n      bugList,\n      localReleases,\n      new Date('2023-04-30T00:00:00Z')\n    )\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(4)\n  })\n\n  it('get mttr for 2 bugs when release after bug 2', () => {\n    const bugList: Issue[] = [\n      {\n        created_at: '2023-04-22T21:44:06Z',\n        closed_at: '2023-04-23T16:47:40Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      },\n      {\n        created_at: '2023-04-25T21:21:49Z',\n        closed_at: '2023-04-29T12:54:45Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      }\n    ] as Issue[]\n    const localReleases = [\n      {\n        published_at: '2023-04-30T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-20T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      }\n    ] as Release[]\n\n    // console.log(fixTime/(1000*60*60*24))\n    const mttrEmpty = new MeanTimeToRestore(\n      bugList,\n      localReleases,\n      new Date('2023-04-30T00:00:00Z')\n    )\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(5)\n  })\n\n  it('get mttr for 2 bugs on two repos when release after bug 2', () => {\n    const bugList: Issue[] = [\n      {\n        // 21 -> 24 = 3\n        created_at: '2023-04-22T21:44:06Z',\n        closed_at: '2023-04-23T16:47:40Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/other-repo'\n      },\n      {\n        // 24 -> 30 = 6\n        created_at: '2023-04-25T21:21:49Z',\n        closed_at: '2023-04-29T12:54:45Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      }\n    ] as Issue[]\n    const localReleases = [\n      {\n        published_at: '2023-04-30T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-20T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-21T00:00:00Z',\n        url: 'path/with/other-repo/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/other-repo/in/it'\n      }\n    ] as Release[]\n\n    const mttrEmpty = new MeanTimeToRestore(\n      bugList,\n      localReleases,\n      new Date('2023-04-30T00:00:00Z')\n    )\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(4.5)\n  })\n\n  it('get mttr for 2 bugs on two repos when no release after bug 1', () => {\n    const bugList: Issue[] = [\n      {\n        // 21 -> 24 = 3\n        created_at: '2023-04-22T21:44:06Z',\n        closed_at: '2023-04-23T16:47:40Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/other-repo'\n      },\n      {\n        // 24 -> 30 = 6\n        created_at: '2023-04-25T21:21:49Z',\n        closed_at: '2023-04-29T12:54:45Z',\n        labels: [{ name: 'bug' }],\n        repository_url: 'some-path/repository'\n      }\n    ] as Issue[]\n    const localReleases = [\n      {\n        published_at: '2023-04-30T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-24T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-20T00:00:00Z',\n        url: 'path/with/repository/in/it'\n      },\n      {\n        published_at: '2023-04-21T00:00:00Z',\n        url: 'path/with/other-repo/in/it'\n      }\n    ] as Release[]\n\n    const mttrEmpty = new MeanTimeToRestore(\n      bugList,\n      localReleases,\n      new Date('2023-04-30T00:00:00Z')\n    )\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(6)\n  })\n  it('get average time to repair', () => {\n    const avMttr: number = mttr.mttr()\n\n    expect(avMttr).toBeGreaterThan(6.4)\n    expect(avMttr).toBeLessThan(7.9)\n  })\n\n  it('throw excepiton when no releases', () => {\n    const emptyReleaseList: Release[] = []\n\n    const t = (): void => {\n      new MeanTimeToRestore(issues, emptyReleaseList)\n    }\n\n    expect(t).toThrow('Empty release list')\n  })\n\n  it('return 0 when no bugs', () => {\n    const emptyBugList: Issue[] = []\n\n    const mttrEmpty = new MeanTimeToRestore(emptyBugList, releases)\n    const meanTime = mttrEmpty.mttr()\n\n    expect(meanTime).toBe(0)\n  })\n})\n"

equency(releaseList2, '2023-05-23T22:33:11Z')\n    const rr = df.rate()\n\n    expect(rr).toBe('0.00')\n  })\n  it('throw exception when no releases', () => {\n    const emptyReleaseList: Release[] = []\n\n    const t = (): void => {\n      new DeployFrequency(emptyReleaseList)\n    }\n\n    expect(t).toThrow('Empty release list')\n  })\n  it('throw exception when release list is null', () => {\n    const emptyReleaseList: Release[] | null = null\n\n    const t = (): void => {\n      new DeployFrequency(emptyReleaseList)\n    }\n\n    expect(t).toThrow('Empty release list')\n  })\n  it('get an empty log of releases', () => {\n    const df = new DeployFrequency(releaseList7, '2023-05-14T22:33:11Z')\n\n    expect(df.getLog().length).toBe(0)\n  })\n\n  it('get release log list weekly when rate calculated', () => {\n    const df = new DeployFrequency(releaseList7, '2023-05-01T22:33:11Z')\n\n    df.weekly()\n\n    expect(\n      df.getLog().map(l => {\n        return l.includes('release')\n      }).length\n    ).toBe(5)\n  })\n\n  it('get release log list monthly when rate calculated', () => {\n    const df = new DeployFrequency(releaseList7, '2023-05-14T22:33:11Z')\n\n    df.monthly()\n\n    expect(\n      df.getLog().map(l => {\n        return l.includes('release')\n      }).length\n    ).toBe(6)\n  })\n\n  it('get release log list when rate calculated', () => {\n    const df = new DeployFrequency(releaseList7, '2023-05-14T22:33:11Z')\n\n    df.rate()\n\n    expect(\n      df.getLog().map(l => {\n        return l.includes('release')\n      }).length\n    ).toBe(6)\n  })\n})\n"
